-- ----------------------------
-- Table structure for tb_capital_log
-- ----------------------------
DROP TABLE IF EXISTS `tb_capital_log`;
CREATE TABLE `tb_capital_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '唯一id',
  `log_no` varchar(30) DEFAULT NULL COMMENT '资金日志号',
  `account_type` int(2) DEFAULT NULL COMMENT '账户类别（1：客户 2：跑客 ）',
  `account_id` bigint(20) DEFAULT NULL COMMENT '账户id',
  `login_name` varchar(20) DEFAULT NULL COMMENT '登录名',
  `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `type` int(2) DEFAULT NULL COMMENT '类别(1、帮送；2、帮取；3、帮买；4：代排队； 5:提现 6:管理员修改；7：充值)',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `order_no` varchar(30) DEFAULT NULL COMMENT '订单号',
  `trade_from` tinyint(4) DEFAULT NULL COMMENT '交易来源，1：余额；2：微信；3、支付宝',
  `trade_no` varchar(255) DEFAULT NULL COMMENT '交易号',
  `withdrawals_id` bigint(20) DEFAULT NULL COMMENT '提现id',
  `capital_change_reason` varchar(50) DEFAULT NULL COMMENT '资金变动事由',
  `change_money` decimal(12,2) DEFAULT NULL COMMENT '变动金额',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL,
  `data_2` int(10) DEFAULT NULL COMMENT '微信或支付宝回调通知使用，1：已通知；0：未通知',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000000196 DEFAULT CHARSET=utf8 COMMENT='资金日志表';

-- ----------------------------
-- Records of tb_capital_log
-- ----------------------------

