  `yesterday_order` int(10) DEFAULT NULL COMMENT '昨日订单量',
  `sevenday_order` int(10) DEFAULT NULL COMMENT '7天订单量',
  `thirtyday_order` int(10) DEFAULT NULL COMMENT '30天订单量',
  `all_order` bigint(20) DEFAULT NULL COMMENT '全部订单量',
  `yesterday_add_customer` int(10) DEFAULT NULL COMMENT '昨日新增客户数',
  `sevenday_add_customer` int(10) DEFAULT NULL COMMENT '7天新增客户数',
  `thirtyday_add_cutomer` int(10) DEFAULT NULL COMMENT '30天新增客户数',
  `all_customer` bigint(20) DEFAULT NULL COMMENT '所有客户',
  `yesterday_recharge_amount` decimal(12,2) DEFAULT NULL COMMENT '昨日充值金额',
  `yesterday_platform_revenue` decimal(12,2) DEFAULT NULL COMMENT '昨日平台佣金收入',
  `sevenday_recharge_amount` decimal(12,2) DEFAULT NULL COMMENT '7天充值金额',
  `sevenday_platform_revenue` decimal(12,2) DEFAULT NULL COMMENT '7天平台佣金收入',
  `thirtyday_recharge_amount` decimal(12,2) DEFAULT NULL COMMENT '30天充值金额',
  `thirtyday_platform_revenue` decimal(12,2) DEFAULT NULL COMMENT '30天平台佣金收入',
  `all_recharge_amount` decimal(12,2) DEFAULT NULL COMMENT '总充值金额',
  `all_platform_revenue` decimal(12,2) DEFAULT NULL COMMENT '平台佣金总收入',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT '' COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='首页信息统计表';

-- ----------------------------
-- Records of tb_information_statistics
-- ----------------------------

-- ----------------------------
-- Table structure for tb_notify
