DROP TABLE IF EXISTS `tb_notify`;
CREATE TABLE `tb_notify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '唯一id',
  `open_city_id` bigint(20) DEFAULT NULL COMMENT '通知城市id',
  `cityName` varchar(20) DEFAULT NULL COMMENT '城市名称',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `content` varchar(500) DEFAULT NULL COMMENT '内容',
  `notify_role` int(2) DEFAULT NULL COMMENT '通知对象(1：客户 2：跑客 3：所有）',
  `role_id` bigint(20) DEFAULT NULL COMMENT '通知对象id',
  `notify_status` int(2) DEFAULT NULL COMMENT '通知状态（1：未通知 2：已通知 ）',
  `notify_date` datetime DEFAULT NULL COMMENT '通知时间',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='通知表';

-- ----------------------------
-- Records of tb_notify
-- ----------------------------

-- ----------------------------
-- Table structure for tb_open_city
-- ----------------------------
DROP TABLE IF EXISTS `tb_open_city`;
CREATE TABLE `tb_open_city` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '唯一id',
  `city_name` varchar(100) NOT NULL COMMENT '城市名称',
  `management_type` int(2) DEFAULT NULL COMMENT '经营类别（1：自营； 2：加盟商）',
  `responsible_name` varchar(20) DEFAULT NULL COMMENT '负责人姓名',
  `responsible_phone` varchar(20) DEFAULT NULL COMMENT '负责人电话',
  `office_address` varchar(255) DEFAULT NULL COMMENT '办公地址',
  `order_prefix` varchar(20) DEFAULT NULL COMMENT '订单前缀',
  `order_serial_date` date DEFAULT NULL COMMENT '订单流水号所在的日期',
  `order_serial_no` int(11) DEFAULT NULL COMMENT '当天订单流水号',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000005 DEFAULT CHARSET=utf8 COMMENT='开通城市表';

-- ----------------------------
-- Records of tb_open_city
-- ----------------------------

-- ----------------------------
-- Table structure for tb_order
-- ----------------------------
DROP TABLE IF EXISTS `tb_order`;
CREATE TABLE `tb_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_type` int(11) DEFAULT NULL COMMENT '订单类型：1、帮送；2、帮取；3、帮买；4：代排队',
  `order_no` varchar(50) DEFAULT NULL COMMENT '订单编号',
  `customer_id` bigint(20) DEFAULT NULL COMMENT '下单人id',
  `customer_name` varchar(100) DEFAULT NULL COMMENT '下单人名字',
  `customer_phone` varchar(20) DEFAULT NULL COMMENT '下单人电话',
  `delivery_man_id` bigint(20) DEFAULT NULL COMMENT '接单人id',
  `delivery_man_name` varchar(100) DEFAULT NULL COMMENT '接单人名称',
  `delivery_man_phone` varchar(20) DEFAULT NULL COMMENT '接单人电话',
  `delivery_man_head_image` varchar(100) DEFAULT NULL COMMENT '接单人头像路径',
  `delivery_order_time` datetime DEFAULT NULL COMMENT '抢单时间',
  `shipping_from` int(11) DEFAULT NULL COMMENT '下单工具：1、微信；2、android；3、ios',
  `longitude` double DEFAULT NULL COMMENT '订单经度；帮送：发货地；帮取：取货地；帮买：买货地；代排队：排队地',
  `latitude` double DEFAULT NULL COMMENT '订单纬度；帮送：发货地；帮取：取货地；帮买：买货地；代排队：排队地',
  `remark` varchar(255) DEFAULT NULL COMMENT '帮送、帮取：备注留言；',
  `order_city` bigint(20) DEFAULT NULL COMMENT '下单城市id',
  `order_city_name` varchar(50) DEFAULT NULL COMMENT '下单城市名称',
  `booking_type` tinyint(4) NOT NULL COMMENT '订单预约类型：1、立即订单；2：预约订单',
  `booking_time` datetime DEFAULT NULL COMMENT '预约时间',
  `original_freight` decimal(12,2) DEFAULT NULL COMMENT '原始跑腿费',
  `actual_freight` decimal(12,2) DEFAULT NULL COMMENT '实际跑腿费',
  `is_use_coupons` tinyint(4) DEFAULT NULL COMMENT '是否使用优惠券：1、使用；0：未使用',
  `use_coupons_id` bigint(20) DEFAULT NULL COMMENT '使用的优惠券id',
  `coupons_money` decimal(12,2) DEFAULT NULL COMMENT '优惠券优惠金额',
  `tips` decimal(12,2) DEFAULT '0.00' COMMENT '小费，打赏费',
  `tips_transaction_id` varchar(255) DEFAULT NULL COMMENT '小费第三方支付返回的支付订单号',
  `create_time` datetime DEFAULT NULL COMMENT '下单时间',
  `special_require` varchar(255) DEFAULT NULL COMMENT '特殊要求（帮送、帮买、帮取使用）',
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '跑腿费支付方式，1：余额支付；2：微信支付；3、支付宝支付',
  `pay_transaction_id` varchar(255) DEFAULT NULL COMMENT '跑腿费第三方支付返回的支付订单号',
  `sms_code` varchar(10) DEFAULT NULL COMMENT '收货验证码（帮送、帮取、帮买）;验证码（代排队）',
  `sign_time` datetime DEFAULT NULL COMMENT '签收时间',
  `action_step` tinyint(4) DEFAULT '0' COMMENT '订单中跑客当前操作步骤',
  `order_cancel_reason` varchar(500) DEFAULT NULL COMMENT '订单取消原因',
  `order_status` tinyint(11) DEFAULT NULL COMMENT '订单状态；1：等待支付；2：等待接单；3、进行中；4、待收货；5、已完成；9：已取消',
  `evaluation_status` tinyint(4) DEFAULT '3' COMMENT '评价状态；1、已评价；2、未评价；3：订单未到评价状态',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '订单取消时间',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000073 DEFAULT CHARSET=utf8 COMMENT='订单表';

-- ----------------------------
-- Records of tb_order
-- ----------------------------

-- ----------------------------
-- Table structure for tb_order_action
-- ----------------------------
DROP TABLE IF EXISTS `tb_order_action`;
CREATE TABLE `tb_order_action` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `action_name` varchar(200) DEFAULT NULL COMMENT '订单动作名称',
  `action_time` datetime DEFAULT NULL COMMENT '订单动作时间',
  `action_type` tinyint(4) DEFAULT NULL COMMENT '动作类型，1、完成动作；2、进行中动作',
  `action_image` varchar(255) DEFAULT NULL COMMENT '部分环节，拍的照片。多个照片，用“||”隔开',
  `show_flag` tinyint(4) DEFAULT '1' COMMENT '显示标志，完成动作后，上一个进行中动作要设置为不显示，1：显示；2、不显示',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000082 DEFAULT CHARSET=utf8 COMMENT='跑客操作步骤表';

-- ----------------------------
-- Records of tb_order_action
-- ----------------------------

-- ----------------------------
-- Table structure for tb_order_cancel
-- ----------------------------
DROP TABLE IF EXISTS `tb_order_cancel`;
CREATE TABLE `tb_order_cancel` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_type` tinyint(4) NOT NULL COMMENT '订单类型：1、帮送；2、帮取；3、帮买；4：代排队',
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `order_no` varchar(50) NOT NULL COMMENT '订单编号',
  `order_status` tinyint(4) DEFAULT NULL COMMENT '订单取消时，订单状态',
  `action_step` tinyint(4) DEFAULT NULL COMMENT '订单取消时，跑客的动作',
  `order_status_remark` varchar(200) DEFAULT NULL COMMENT '订单状态描述',
  `check_user_id` bigint(20) DEFAULT NULL COMMENT '审核人id',
  `check_time` datetime DEFAULT NULL COMMENT '审核时间',
  `check_state` tinyint(4) DEFAULT NULL COMMENT '审核状态（1：审核通过 2：未审核 3：审核未通过 ）',
  `create_time` datetime DEFAULT NULL COMMENT '订单取消时间',
  `is_timeout` tinyint(4) DEFAULT NULL COMMENT '是否超时取消订单，超时，将扣除部分跑腿费。1：未超时，2：超时',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态（1：正常 2：已删除）',
  `data_1` varchar(255) DEFAULT NULL,
  `data_2` varchar(255) DEFAULT NULL,
  `data_3` varchar(255) DEFAULT NULL,
  `data_4` varchar(255) DEFAULT NULL,
  `data_5` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='退款审核表';

-- ----------------------------
-- Records of tb_order_cancel
-- ----------------------------

-- ----------------------------
-- Table structure for tb_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `tb_order_goods`;
CREATE TABLE `tb_order_goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `location_address_a` varchar(200) DEFAULT NULL COMMENT '定位地址-帮送：发货地；帮取：取货地；帮买：购买地',
  `location_address_name_a` varchar(200) DEFAULT NULL COMMENT '定位地址概述-帮送：发货地；帮取：取货地；帮买：购买地',
  `detail_address_a` varchar(255) DEFAULT NULL COMMENT '详细地址，如楼层/门牌号-帮送：发货地；帮取：取货地；帮买：购买地',
  `longitude_a` double DEFAULT NULL COMMENT '经度-帮送：发货地；帮取：取货地；帮买：购买地',
  `latitude_a` double DEFAULT NULL COMMENT '纬度-帮送：发货地；帮取：取货地；帮买：购买地',
  `mobile_phone_a` varchar(255) DEFAULT NULL COMMENT '手机号-帮送：发货人；帮取：取货地联系人',
  `linkman_name_a` varchar(255) DEFAULT NULL COMMENT '联系人姓名-帮送：发货人；帮取：取货地联系人',
  `location_address_b` varchar(255) DEFAULT NULL COMMENT '定位地址-收货地',
  `location_address_name_b` varchar(255) DEFAULT NULL COMMENT '定位地址概述-收货地',
  `detail_address_b` varchar(255) DEFAULT NULL COMMENT '详细地址，如楼层/门牌号-收货地',
  `longitude_b` double DEFAULT NULL COMMENT '经度-收货地',
  `latitude_b` double DEFAULT NULL COMMENT '纬度-收货地',
  `mobile_phone_b` varchar(255) DEFAULT NULL COMMENT '收货人联系电话',
  `linkman_name_b` varchar(255) CHARACTER SET utf8 COLLATE utf8_latvian_ci DEFAULT NULL COMMENT '收货人姓名（可不填）',
  `goods_type_id` int(11) DEFAULT NULL COMMENT '货物类型（帮送、帮取）',
  `goods_type_name` varchar(255) DEFAULT NULL COMMENT '货物类型名称（帮送、帮取）',
  `buy_require` varchar(255) DEFAULT NULL COMMENT '购买要求（帮买）',
  `buy_link_phone` varchar(255) DEFAULT NULL COMMENT '帮买联系电话（帮买）',
  `is_konw_price` tinyint(4) DEFAULT NULL COMMENT '是否知道价格；1、知道价格；2、不知道价格（帮买）',
  `buy_price` decimal(12,2) DEFAULT NULL COMMENT '知道价格时，输入的商品价格（帮买）',
  `is_near_buy` tinyint(4) DEFAULT NULL COMMENT '是否就近购买(1：收货地附近就近购买；2：指定购买地）',
  `add_pay_money` decimal(12,2) DEFAULT NULL COMMENT '购买中支付的商品费（帮买）',
  `add_pay_time` datetime DEFAULT NULL COMMENT '购买中支付商品费的时间（帮买）',
  `add_pay_transaction_id` varchar(255) DEFAULT NULL COMMENT '第三方支付返回的支付订单号（帮买）',
  `total_distance` decimal(10,2) DEFAULT '0.00' COMMENT '订单总里程(单位：公里）',
  `total_time` int(10) DEFAULT '0' COMMENT '订单总时间（从拿到货到签收时间,单位：分钟）',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000057 DEFAULT CHARSET=utf8 COMMENT='订单-帮送、帮取、帮买表';

-- ----------------------------
-- Records of tb_order_goods
