DROP TABLE IF EXISTS `tb_order_lineup`;
CREATE TABLE `tb_order_lineup` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) NOT NULL COMMENT '订单id',
  `location_address` varchar(255) DEFAULT NULL COMMENT '排队地点定位地址',
  `location_address_name` varchar(255) DEFAULT NULL COMMENT '排队地点定位地址概述',
  `detail_address` varchar(255) DEFAULT NULL COMMENT '排队地点详细地址，如楼层/门牌号',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  `lineup_require` varchar(255) DEFAULT NULL COMMENT '排队要求',
  `lineup_duration` int(11) DEFAULT NULL COMMENT '排队时长，单位：分钟',
  `lineup_phone` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `add_pay_money` decimal(12,2) DEFAULT NULL COMMENT '排队加时支付的金额',
  `add_pay_duration` int(11) DEFAULT NULL COMMENT '排队加时时长，单位:分钟',
  `add_pay_time` datetime DEFAULT NULL COMMENT '排队加时支付时间',
  `add_pay_transaction_id` varchar(255) DEFAULT NULL COMMENT '第三方支付返回的支付订单号',
  `lineup_begin_time` datetime DEFAULT NULL COMMENT '排队开始时间',
  `lineup_end_time` datetime DEFAULT NULL COMMENT '排队结束时间',
  `lineup_real_duration` int(11) DEFAULT '0' COMMENT '排队实际时长',
  `lineup_real_money` decimal(12,2) DEFAULT NULL COMMENT '排队实际费用',
  `status` int(2) DEFAULT '1' COMMENT '状态（1：正常 2：已删除）',
  `data_1` bigint(20) DEFAULT NULL COMMENT '扩展1',
  `data_2` int(10) DEFAULT NULL COMMENT '扩展2',
  `data_3` varchar(255) DEFAULT NULL COMMENT '扩展3',
  `data_4` varchar(255) DEFAULT NULL COMMENT '扩展4',
  `data_5` varchar(255) DEFAULT NULL COMMENT '扩展5',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='排队订单表';

