-- ----------------------------
-- Table structure for tb_sys_button
-- ----------------------------
DROP TABLE IF EXISTS `tb_sys_button`;
CREATE TABLE `tb_sys_button` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `nid` bigint(20) DEFAULT NULL COMMENT '处理分布式部署问题，数据关联全部使用nid进行关联',
  `menu_id` bigint(20) DEFAULT NULL COMMENT '菜单id',
  `menu_nid` bigint(20) NOT NULL COMMENT '菜单nid',
  `button_name` varchar(20) DEFAULT NULL COMMENT '按钮名称',
  `button_url` varchar(500) DEFAULT NULL COMMENT '按钮url',
  `button_icon` varchar(100) DEFAULT NULL COMMENT '按钮图标',
