  `unit_type` int(10) DEFAULT '0' COMMENT '单位类型：1：行业平台、2：省级代理、3：地方代理、10国家级机构，11省级机构，12市县级机构',
  `unit_kind` int(10) DEFAULT '0' COMMENT '1平台类、2服务类、3销售类、4其他',
  `zone_code` varchar(50) DEFAULT NULL COMMENT '区域编码',
  `unit_domain` varchar(50) DEFAULT NULL COMMENT '单位域名',
  `unit_name` varchar(100) DEFAULT NULL COMMENT '单位名称 和营业执照一致',
  `short_name` varchar(100) DEFAULT NULL COMMENT '单位简称',
  `reg_date` datetime DEFAULT NULL COMMENT '单位注册日期',
  `stop_date` datetime DEFAULT NULL COMMENT '单位停用日期',
  `user_count` bigint(10) DEFAULT NULL COMMENT '单位用户总数',
  `unit_status` varchar(20) DEFAULT NULL COMMENT '单位状态： 包括注册，初审，复审，核准，停用初审，停用复审，停用核准',
  `admin_url` varchar(100) DEFAULT NULL COMMENT '管理URL',
  `portal_url` varchar(100) DEFAULT NULL COMMENT 'portal URL',
  `unit_address` varchar(100) DEFAULT NULL COMMENT '单位地址 和营业执照一致',
  `tel_area_code` varchar(10) DEFAULT NULL COMMENT '电话区号',
  `tel` varchar(20) DEFAULT NULL COMMENT '电话',
  `tel_service` varchar(20) DEFAULT NULL COMMENT '服务电话',
  `fax` varchar(10) DEFAULT NULL COMMENT '传真',
  `legal_person` varchar(20) DEFAULT NULL COMMENT '单位法人',
  `legal_person_mobile` varchar(20) DEFAULT NULL COMMENT '单位法人手机',
  `logo_path` varchar(500) DEFAULT NULL COMMENT 'logo地址，相对位置，在正常使用的时候在前边加上对应的服务url即可访问',
  `logo_url` varchar(500) DEFAULT NULL COMMENT 'logo的url地址',
  `version` int(10) DEFAULT '0' COMMENT '版本号',
  `ord` bigint(20) DEFAULT '1' COMMENT '排序',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `status` int(10) DEFAULT '1' COMMENT '状态字段 1正常，0锁定，-1删除',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10000062 DEFAULT CHARSET=utf8 COMMENT='单位表';

